import { GET_PRESENCES_DETAIL } from './../constants/types';

const initialState = {
    class: {},
    presenceList: [],
    checkDateList: []
}
export default function(state = initialState, action) {
    switch(action.type)
    {
        case GET_PRESENCES_DETAIL:
            return {
                ...state,
                class: action.payload.classes,
                presenceList: action.payload.presencesList,
                checkDateList: action.payload.checkDate
            }
        default:
            return state;
    }
}
